    <style>
      #ngx-splash-screen {
        display: block;
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
      }

      #ngx-splash-screen > .splash-screen-wrapper {
        position: fixed;
        top: calc(50% - 90px);
        left: calc(50% - 90px);
        background-repeat: no-repeat;
        background-position: top center;
        background-size: contain;
        width: 180px;
        height: 180px;
        display: block;
        margin: 0 auto;
        background-color: transparent;
        /* Support for all WebKit browsers. */
        -webkit-font-smoothing: antialiased;
        /* Support for Safari and Chrome. */
        text-rendering: optimizeLegibility;

        /* Support for Firefox. */
        -moz-osx-font-smoothing: grayscale;

        /* Support for IE. */
        font-feature-settings: 'liga';
      }

      #ngx-splash-screen > .splash-screen-wrapper > .loading {
        position: fixed;
        top: calc(50% + 100px);
        left: calc(50% - 45px);
      }
    </style>
